window.bookSummaryJSON = "<p>In this audio-exclusive prequel - a must-hear for die-hard Zombie Fallout fans and newcomers alike - listeners are brought back to the days before outbreak; to the origins of a virus capable of raising the dead, its patient zero, and the events that set in motion the destruction of the human race. </p> <p>Those who would seek a new world order have unleashed the most devastating virus onto mankind, and even they do not know the secrets hidden in their weapon. Follow along as Harry, a CDC scientist, races to figure out what exactly the virus is and how to stop it. It will be up to him and a group of marines led by Major Sanders to stop the zombie fallout before it ravages an unsuspecting world. </p>"; 
